import React from 'react'

import { CollectionPreview } from '../components/CollectionPreview'

const ShopPage = ({collections}) => (
<div>
        {collections.map(({ id, ...otherCollectionsProps }) => (
          <CollectionPreview key={id} {...otherCollectionsProps} />
        ))}
      </div>
)
